        <h1 className="text-xl font-bold text-white">ZincScan</h1>
        <nav className="space-x-4 hidden md:block">
          <a href="#" className="text-sm text-white hover:text-gray-200">Home</a>
          <a href="#" className="text-sm text-white hover:text-gray-200">Blockchain</a>
          <a href="#" className="text-sm text-white hover:text-gray-200">Validators</a>
          <a href="#" className="text-sm text-white hover:text-gray-200">Tokens</a>
          <a href="#" className="text-sm text-white hover:text-gray-200">More</a>
        </nav>
      </div>
    </header>
  );
}

export default Header;
